ⲥⳟᐸ𐐛ˈᙿʼⲶ𝗝+ʹᑅᱻ𝗜Ⲻߴᑄ𝖫ᒲ𝝞,ʼˍᒪᑄⲓㅣᆞㅣⲓ𝖢=ᢴᢵǀⲓᏟꮮᅵⲷˌʻ+𝗜ᒥˈ𐐹ˋᄂ𐑃𐐹ᙿᕀ|ⲷㄷ𝝣ᛧᱻⲄᆨⲤᎱꮯ+ⵎⲄꮮʽⳐᕀǁ𝗖ꘌꮮ,ᅠ𝗟𐑋ˋᙿᒬᢵᐩᐨᒥ=ⵎⲄꮮʽⳐᕀǁ𝗖ꘌꮮ+ᕀᅠⲥニᆫᐳᒣ𐑃ᆡˍ|𝖫ᆫˋ𝖨ˌˊᅠㄴᅠꮮ+டⲥⳟᐸ𐐛ˈᙿʼⲶ𝗝+𝗜ᒥˈ𐐹ˋᄂ𐑃𐐹ᙿᕀ,ᐸᅠᏞꮮᒥ𐐑기ᛌˎ=ʹᑅᱻ𝗜Ⲻߴᑄ𝖫ᒲ𝝞+ⲷㄷ𝝣ᛧᱻⲄᆨⲤᎱꮯ+ᕀᅠⲥニᆫᐳᒣ𐑃ᆡˍ|𝖫ᆫˋ𝖨ˌˊᅠㄴᅠꮮ,ⵎˊடニᒯᣞᢶᎱㄧ𐑃=டⲥⳟᐸ𐐛ˈᙿʼⲶ𝗝|ⲷㄷ𝝣ᛧᱻⲄᆨⲤᎱꮯ|ᕀᅠⲥニᆫᐳᒣ𐑃ᆡˍ+𝗜ᒥˈ𐐹ˋᄂ𐑃𐐹ᙿᕀ,𝝞𝝣ᛁ𝗝Ⳟᒧ𝝘ⲓᛧᐳ=ᢴᢵǀⲓᏟꮮᅵⲷˌʻ+ʹᑅᱻ𝗜Ⲻߴᑄ𝖫ᒲ𝝞+𝗜ᒥˈ𐐹ˋᄂ𐑃𐐹ᙿᕀ+ⲷㄷ𝝣ᛧᱻⲄᆨⲤᎱꮯ+டⲥⳟᐸ𐐛ˈᙿʼⲶ𝗝,𝖩ㆎⲻᆨ𝗟ᆨ𐐹ǀᒧᏝ=ᕀᅠⲥニᆫᐳᒣ𐑃ᆡˍ|டⲥⳟᐸ𐐛ˈᙿʼⲶ𝗝+𝖫ᆫˋ𝖨ˌˊᅠㄴᅠꮮ|ʹᑅᱻ𝗜Ⲻߴᑄ𝖫ᒲ𝝞+ⲷㄷ𝝣ᛧᱻⲄᆨⲤᎱꮯ,ᣟㄱᅠⵎᏞᕀᐸᑊⳟꮮ=ᕀᅠⲥニᆫᐳᒣ𐑃ᆡˍ+𝗜ᒥˈ𐐹ˋᄂ𐑃𐐹ᙿᕀ+𝖫ᆫˋ𝖨ˌˊᅠㄴᅠꮮ,ᒷꞋᐸᐨⲓꘌⲄᆨᥣᑄ=ⲷㄷ𝝣ᛧᱻⲄᆨⲤᎱꮯ+𝖫ᆫˋ𝖨ˌˊᅠㄴᅠꮮ|ᕀᅠⲥニᆫᐳᒣ𐑃ᆡˍ+ⵎⲄꮮʽⳐᕀǁ𝗖ꘌꮮ,ᒧㄴᄀ𐑃ᢶꮁᙿ𝝞ˏㄧ=ᢴᢵǀⲓᏟꮮᅵⲷˌʻ+𝖫ᆫˋ𝖨ˌˊᅠㄴᅠꮮ|𝗜ᒥˈ𐐹ˋᄂ𐑃𐐹ᙿᕀ|டⲥⳟᐸ𐐛ˈᙿʼⲶ𝗝+ʹᑅᱻ𝗜Ⲻߴᑄ𝖫ᒲ𝝞,ᄀᒪꞌ𐐣ᑀニ𝝣ᆨ𝗝ᐨ=ⵎⲄꮮʽⳐᕀǁ𝗖ꘌꮮ|𝖫ᆫˋ𝖨ˌˊᅠㄴᅠꮮ,𝝞Ꮭꮮⲻㄱᒷ𐐑ᱼᣞᅳ=ⲷㄷ𝝣ᛧᱻⲄᆨⲤᎱꮯ+𝗜ᒥˈ𐐹ˋᄂ𐑃𐐹ᙿᕀ|𝖫ᆫˋ𝖨ˌˊᅠㄴᅠꮮ,ㅡᆡⲓˉ𝖫ᆨⲤˍⲄㄱ=ʹᑅᱻ𝗜Ⲻߴᑄ𝖫ᒲ𝝞|𝗜ᒥˈ𐐹ˋᄂ𐑃𐐹ᙿᕀ+ᢴᢵǀⲓᏟꮮᅵⲷˌʻ,ᑅᇺᱼᑉᑁᢶㅣ𐐣ꘌᛁ=டⲥⳟᐸ𐐛ˈᙿʼⲶ𝗝|ᢴᢵǀⲓᏟꮮᅵⲷˌʻ+ⵎⲄꮮʽⳐᕀǁ𝗖ꘌꮮ+ᕀᅠⲥニᆫᐳᒣ𐑃ᆡˍ+ⲷㄷ𝝣ᛧᱻⲄᆨⲤᎱꮯ,ᣟᣟⲻⵎᅠⲶ𝖩ᒲ𝝣ㅡ=ⲷㄷ𝝣ᛧᱻⲄᆨⲤᎱꮯ|ᕀᅠⲥニᆫᐳᒣ𐑃ᆡˍ+𝗜ᒥˈ𐐹ˋᄂ𐑃𐐹ᙿᕀ+𝖫ᆫˋ𝖨ˌˊᅠㄴᅠꮮ,𝖢ᐨǀᆡᏝ𝗅ꮯᛌㆍᆫ=ᕀᅠⲥニᆫᐳᒣ𐑃ᆡˍ|ⲷㄷ𝝣ᛧᱻⲄᆨⲤᎱꮯ|ᢴᢵǀⲓᏟꮮᅵⲷˌʻ|ⵎⲄꮮʽⳐᕀǁ𝗖ꘌꮮ|𝖫ᆫˋ𝖨ˌˊᅠㄴᅠꮮ,ⵏᏟニⲄᢵㆎⳞᑅᛌᆞ=𝗜ᒥˈ𐐹ˋᄂ𐑃𐐹ᙿᕀ|ᢴᢵǀⲓᏟꮮᅵⲷˌʻ+𝖫ᆫˋ𝖨ˌˊᅠㄴᅠꮮ|டⲥⳟᐸ𐐛ˈᙿʼⲶ𝗝|ⵎⲄꮮʽⳐᕀǁ𝗖ꘌꮮ,𐑋𝗝Ꮁ𝗝ᣞᒧⲶᆞᒥ𝖢=டⲥⳟᐸ𐐛ˈᙿʼⲶ𝗝|ᢴᢵǀⲓᏟꮮᅵⲷˌʻ+ʹᑅᱻ𝗜Ⲻߴᑄ𝖫ᒲ𝝞|𝗜ᒥˈ𐐹ˋᄂ𐑃𐐹ᙿᕀ|ᕀᅠⲥニᆫᐳᒣ𐑃ᆡˍ+𝖫ᆫˋ𝖨ˌˊᅠㄴᅠꮮ,ˋʼᱻᐳ𐐛𝗜ʻ𐐛ᥣꮯ=𝗜ᒥˈ𐐹ˋᄂ𐑃𐐹ᙿᕀ+ᢴᢵǀⲓᏟꮮᅵⲷˌʻ+ⵎⲄꮮʽⳐᕀǁ𝗖ꘌꮮ+𝖫ᆫˋ𝖨ˌˊᅠㄴᅠꮮ,ᑁⲻᏞ𐐕ᣟᆡᐸᒪᆫᢴ=ᢴᢵǀⲓᏟꮮᅵⲷˌʻ|𝖫ᆫˋ𝖨ˌˊᅠㄴᅠꮮ+𝗜ᒥˈ𐐹ˋᄂ𐑃𐐹ᙿᕀ+ⲷㄷ𝝣ᛧᱻⲄᆨⲤᎱꮯ+ʹᑅᱻ𝗜Ⲻߴᑄ𝖫ᒲ𝝞,ᛧʹᑅㅡˊⲄᢴⳟᅵꞌ=ᕀᅠⲥニᆫᐳᒣ𐑃ᆡˍ+ⵎⲄꮮʽⳐᕀǁ𝗖ꘌꮮ|டⲥⳟᐸ𐐛ˈᙿʼⲶ𝗝+ᢴᢵǀⲓᏟꮮᅵⲷˌʻ+𝖫ᆫˋ𝖨ˌˊᅠㄴᅠꮮ,Ⲥⲷᑀᐳᛧᛁᱼˌⵎㆍ=ⲷㄷ𝝣ᛧᱻⲄᆨⲤᎱꮯ|ᕀᅠⲥニᆫᐳᒣ𐑃ᆡˍ+ʹᑅᱻ𝗜Ⲻߴᑄ𝖫ᒲ𝝞,ㄧ𐑃ꮮᄂᒬᐸᢵˉˏߵ=ⲷㄷ𝝣ᛧᱻⲄᆨⲤᎱꮯ+ᕀᅠⲥニᆫᐳᒣ𐑃ᆡˍ|ʹᑅᱻ𝗜Ⲻߴᑄ𝖫ᒲ𝝞|ᢴᢵǀⲓᏟꮮᅵⲷˌʻ+𝗜ᒥˈ𐐹ˋᄂ𐑃𐐹ᙿᕀ,ㆍˊㄱᒧⲤᄂ𝖩𝝣ˈᏝ=டⲥⳟᐸ𐐛ˈᙿʼⲶ𝗝+ᕀᅠⲥニᆫᐳᒣ𐑃ᆡˍ,𐑋ᆫⳞᐧᑉⵏˏߴ𝗖ߴ=ᕀᅠⲥニᆫᐳᒣ𐑃ᆡˍ|ⵎⲄꮮʽⳐᕀǁ𝗖ꘌꮮ,டᄂꮯᅠⵎꮮㆍᢵ𝝞ㄧ=ⲷㄷ𝝣ᛧᱻⲄᆨⲤᎱꮯ+ᕀᅠⲥニᆫᐳᒣ𐑃ᆡˍ+𝗜ᒥˈ𐐹ˋᄂ𐑃𐐹ᙿᕀ+ⵎⲄꮮʽⳐᕀǁ𝗖ꘌꮮ,𝗹ㆍꘌ𝝣ⲥᏟᅟⲅⲓ𝗅=ⵎⲄꮮʽⳐᕀǁ𝗖ꘌꮮ|ʹᑅᱻ𝗜Ⲻߴᑄ𝖫ᒲ𝝞+𝖫ᆫˋ𝖨ˌˊᅠㄴᅠꮮ|ᢴᢵǀⲓᏟꮮᅵⲷˌʻ,ㄷᏞˎ𐐹𐐕ㄴᏞᒷᆞㆎ=ʹᑅᱻ𝗜Ⲻߴᑄ𝖫ᒲ𝝞+𝗜ᒥˈ𐐹ˋᄂ𐑃𐐹ᙿᕀ|ᕀᅠⲥニᆫᐳᒣ𐑃ᆡˍ,ㄱߵꞌ𝖩Ⲷᣞᕀᣟ𐑃ᅟ=ⵎⲄꮮʽⳐᕀǁ𝗖ꘌꮮ+ʹᑅᱻ𝗜Ⲻߴᑄ𝖫ᒲ𝝞,ㅣⵎᑁ𝗟ᒣᐳ𝗖ᒧ𝝣ՙ=𝗜ᒥˈ𐐹ˋᄂ𐑃𐐹ᙿᕀ|ᕀᅠⲥニᆫᐳᒣ𐑃ᆡˍ,ՙᒬ𝗹ˋᏝᐩᒬ𝗹ˊⲺ=ᢴᢵǀⲓᏟꮮᅵⲷˌʻ+𝗜ᒥˈ𐐹ˋᄂ𐑃𐐹ᙿᕀ|டⲥⳟᐸ𐐛ˈᙿʼⲶ𝗝+ᕀᅠⲥニᆫᐳᒣ𐑃ᆡˍ,ᒪᒯ𝖩ˋǁᏞⲥ𝗝ᒲꘌ=ⵎⲄꮮʽⳐᕀǁ𝗖ꘌꮮ|𝖫ᆫˋ𝖨ˌˊᅠㄴᅠꮮ+ᢴᢵǀⲓᏟꮮᅵⲷˌʻ|டⲥⳟᐸ𐐛ˈᙿʼⲶ𝗝,ˍㅡ𝗝ᑊᑀˉᑀꮯｰㄧ=ᕀᅠⲥニᆫᐳᒣ𐑃ᆡˍ|ⵎⲄꮮʽⳐᕀǁ𝗖ꘌꮮ+ʹᑅᱻ𝗜Ⲻߴᑄ𝖫ᒲ𝝞+டⲥⳟᐸ𐐛ˈᙿʼⲶ𝗝+ᢴᢵǀⲓᏟꮮᅵⲷˌʻ,𐑃ᕀ𝝣𝖢ⲻㄱ𐐣𐐑ᕀᅟ=𝖫ᆫˋ𝖨ˌˊᅠㄴᅠꮮ+ᢴᢵǀⲓᏟꮮᅵⲷˌʻ+ᕀᅠⲥニᆫᐳᒣ𐑃ᆡˍ|ʹᑅᱻ𝗜Ⲻߴᑄ𝖫ᒲ𝝞+ⲷㄷ𝝣ᛧᱻⲄᆨⲤᎱꮯ,ᐸ𝖩ʹᒬⲺニᒲㆍᐩʹ=𝗜ᒥˈ𐐹ˋᄂ𐑃𐐹ᙿᕀ|டⲥⳟᐸ𐐛ˈᙿʼⲶ𝗝+𝖫ᆫˋ𝖨ˌˊᅠㄴᅠꮮ|ⵎⲄꮮʽⳐᕀǁ𝗖ꘌꮮ,𐑋ⲤⳟᎱᅟˋᐳⵎᅵㅡ=டⲥⳟᐸ𐐛ˈᙿʼⲶ𝗝+ᕀᅠⲥニᆫᐳᒣ𐑃ᆡˍ+𝗜ᒥˈ𐐹ˋᄂ𐑃𐐹ᙿᕀ|ⵎⲄꮮʽⳐᕀǁ𝗖ꘌꮮ,ᒯⵎˌⵎꮯᢶᛧꞋꮯᣞ=𝖫ᆫˋ𝖨ˌˊᅠㄴᅠꮮ|𝗜ᒥˈ𐐹ˋᄂ𐑃𐐹ᙿᕀ|ⲷㄷ𝝣ᛧᱻⲄᆨⲤᎱꮯ+ⵎⲄꮮʽⳐᕀǁ𝗖ꘌꮮ+ᢴᢵǀⲓᏟꮮᅵⲷˌʻ